import React from 'react'
import styled from 'styled-components';

function Players() {
  return (
    <PlayersContainer>
        <html>

          <div className='row1'>
          <p> Name </p>
          <p> Fantasy Points </p>
          <p> Team </p>
          </div>

        </html>

    </PlayersContainer>
  )
}

const PlayersContainer = styled.div`
.row1 {
  display: flex;
}
p {
  padding: 5px;
  background-color: lightgrey;
  border: 1px solid black;
}
`;

export default Players
